export const GuitarTabsList = () => {
  return (
    <>
      <form action="">
        <label htmlFor="">
          KEY
          <input type="text" />
        </label>

        <label htmlFor="">
          SUFFIX
          <input type="text" />
        </label>
      </form>
      <div>
        <ul></ul>
      </div>
    </>
  );
};

